from typing import List, Optional

# Definition for singly-linked list.
class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next

class Solution:
    def create_linked_list(self, arr):
        head = ListNode(arr[0])
        node = head
        for n in arr[1:]:
            next_node = ListNode(n)
            node.next = next_node
            node = next_node
        return head

    def print_linked_list(self, head):
        node = head
        print(node.val, end='')
        node = node.next
        while node:
            print(f' -> {node.val}', end='')
            node = node.next
        print('')

    def spiralMatrix(self, m: int, n: int, head: Optional[ListNode]) -> List[List[int]]:
        direction = [0,1,2,3] # Right, Down, Left, Up
        step = [(0,1), (1,0), (0,-1), (-1,0)]
        res = [[-1 for _ in range(n)] for _ in range(m)]
        direction = 0
        r, c = 0, 0
        while head:
            #print(r, c, head.val)
            res[r][c] = head.val
            head = head.next
            dr, dc = step[direction]
            rnew, cnew = r + dr, c + dc
            if rnew < 0 or rnew >= m or cnew < 0 or cnew >= n or res[rnew][cnew] != -1:
                direction = (direction + 1) % 4
                dr, dc = step[direction]
                rnew, cnew = r + dr, c + dc
            r, c = rnew, cnew
        return res


